import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useLocation } from 'react-router-dom';
import { Home, FileText, BarChart3, Mic } from 'lucide-react';
import { Home as HomePage } from './pages/Home';
import { Cases } from './pages/Cases';
import { Analytics } from './pages/Analytics';

const Navigation: React.FC = () => {
  const location = useLocation();

  const navItems = [
    { path: '/', icon: Home, label: 'Dashboard' },
    { path: '/record', icon: Mic, label: 'Record' },
    { path: '/cases', icon: FileText, label: 'Cases' },
    { path: '/analytics', icon: BarChart3, label: 'Analytics' }
  ];

  return (
    <nav className="bg-white shadow-sm border-b">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-16">
          <div className="flex items-center">
            <div className="flex-shrink-0">
              <h1 className="text-xl font-bold text-gray-900">Medical Case Tracker</h1>
            </div>
          </div>

          <div className="flex space-x-8">
            {navItems.map((item) => {
              const isActive = location.pathname === item.path;
              return (
                <Link
                  key={item.path}
                  to={item.path}
                  className={`inline-flex items-center px-1 pt-1 text-sm font-medium transition-colors ${
                    isActive
                      ? 'text-blue-600 border-b-2 border-blue-600'
                      : 'text-gray-500 hover:text-gray-700'
                  }`}
                >
                  <item.icon className="w-4 h-4 mr-2" />
                  {item.label}
                </Link>
              );
            })}
          </div>
        </div>
      </div>
    </nav>
  );
};

const RecordPage: React.FC = () => {
  const [isRecording, setIsRecording] = useState(false);
  const [isUploading, setIsUploading] = useState(false);

  const handleRecord = () => {
    // For now, just toggle the recording state
    // You'll implement the actual MediaRecorder API later
    setIsRecording(!isRecording);

    if (!isRecording) {
      // Start recording
      console.log('Starting recording...');
      // TODO: Implement MediaRecorder API
    } else {
      // Stop recording
      console.log('Stopping recording...');
      // TODO: Process the recording
    }
  };

  const handleFileUpload = async (event: React.ChangeEvent<HTMLInputElement>) => {
    const file = event.target.files?.[0];
    if (!file) return;

    setIsUploading(true);
    try {
      // For testing, you can upload an audio file
      const { ApiService } = await import('./services/api');
      const result = await ApiService.uploadAudio(file);
      console.log('Upload result:', result);
      alert('File uploaded and processed successfully!');
    } catch (error) {
      console.error('Upload failed:', error);
      alert('Upload failed. Make sure the backend is running.');
    } finally {
      setIsUploading(false);
    }
  };

  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      <div className="bg-white rounded-lg shadow-md p-6">
        <h2 className="text-xl font-semibold mb-4">Record New Case</h2>

        <div className="flex flex-col items-center space-y-4">
          {/* Recording Status */}
          <div className="text-center">
            {isRecording && (
              <div className="text-red-500 font-medium animate-pulse">
                🔴 Recording in progress...
              </div>
            )}
          </div>

          {/* Control Buttons */}
          <div className="flex space-x-4">
            <button
              onClick={handleRecord}
              className={`px-6 py-3 rounded-lg flex items-center space-x-2 transition-colors ${
                isRecording 
                  ? 'bg-red-500 hover:bg-red-600 text-white' 
                  : 'bg-blue-500 hover:bg-blue-600 text-white'
              }`}
            >
              <Mic className="w-5 h-5" />
              <span>{isRecording ? 'Stop Recording' : 'Start Recording'}</span>
            </button>
          </div>

          {/* File Upload Option */}
          <div className="w-full max-w-md">
            <div className="text-center text-gray-500 mb-4">or</div>
            <label className="block">
              <input
                type="file"
                accept="audio/*"
                onChange={handleFileUpload}
                disabled={isUploading}
                className="block w-full text-sm text-gray-500
                  file:mr-4 file:py-2 file:px-4
                  file:rounded-lg file:border-0
                  file:text-sm file:font-semibold
                  file:bg-blue-50 file:text-blue-700
                  hover:file:bg-blue-100
                  disabled:opacity-50"
              />
            </label>
            {isUploading && (
              <div className="mt-2 text-center text-blue-600">
                Processing audio file...
              </div>
            )}
          </div>

          <div className="text-sm text-gray-600 text-center max-w-md">
            <p>Record your medical case or upload an audio file. The system will automatically transcribe and analyze the content.</p>
            <p className="mt-2 text-xs text-gray-500">
              Note: Make sure your backend server is running on localhost:8000
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

const App: React.FC = () => {
  return (
    <Router>
      <div className="min-h-screen bg-gray-50">
        <Navigation />

        <main>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/record" element={<RecordPage />} />
            <Route path="/cases" element={<Cases />} />
            <Route path="/analytics" element={<Analytics />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
};

export default App;
